impl Drop for Ducc {
    fn drop(&mut self) {
        if !self.is_top {
            return;
        }

        unsafe {
            let udata = get_udata(self.ctx);
            let any_map = get_any_map(self.ctx);
            ffi::duk_destroy_heap(self.ctx);
            Box::from_raw(udata);
            Box::from_raw(any_map);
        }
    }
}
